                        <html><head><meta charset="utf-8"></head><body>
<p>Туалет-домик для кошек и котов изготовленный из полипропилена не занимает много места и удовлетворяет потребности вашего любимца в чистоте и уединении, убережет ваш дом от неприятных запахов и рассыпавшегося наполнителя.</p>
